import React, { useState, useEffect } from "react";
import axios from "axios";
import "./Dashboard.css";

function Dashboard() {
  const [batch, setBatch] = useState(""); // State for Batch filter
  const [course, setCourse] = useState(""); // State for Course filter
  const [students, setStudents] = useState([]); // State for student data
  const [loading, setLoading] = useState(false); // State for loading spinner

  // Function to Fetch Students from Backend
  const fetchStudents = async () => {
    setLoading(true); // Show loading spinner
    // try {
    //   const response = await axios.get("http://localhost:8080/students", {
    //     params: { batch, course }, // Send filters as query params
    //   });
    //   setStudents(response.data); // Update student data
    // } catch (error) {
    //   console.error("Error fetching students:", error);
    // }
    // setLoading(false); // Hide loading spinner
  };

  // Fetch students whenever filters (batch or course) change
  useEffect(() => {
    fetchStudents();
  }, [batch, course]);

  return (
    <div className="dashboard">
      <h4>Dashboard > Student</h4>

      {/* Filters Section */}
      <div className="filters">
        <div className="filter">
          <label htmlFor="batch">Batch:</label>
          <select
            id="batch"
            value={batch}
            onChange={(e) => setBatch(e.target.value)}
          >
            <option value="">All</option>
            <option value="2023">2023</option>
            <option value="2022">2022</option>
          </select>
        </div>
        <div className="filter">
          <label htmlFor="course">Course:</label>
          <select
            id="course"
            value={course}
            onChange={(e) => setCourse(e.target.value)}
          >
            <option value="">All</option>
            <option value="B.Tech">B.Tech</option>
            <option value="M.Tech">M.Tech</option>
            <option value="MBA">MBA</option>
          </select>
        </div>
      </div>

      {/* Loading Spinner */}
      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          {/* Student Details Table */}
          <h5>Student Details</h5>
          <table className="table">
            <thead>
              <tr>
                <th>Sr. No.</th>
                <th>Name</th>
                <th>Batch</th>
                <th>Course</th>
              </tr>
            </thead>
            <tbody>
              {students.length > 0 ? (
                students.map((student) => (
                  <tr key={student.id}>
                    <td>{student.srNo}</td>
                    <td>{student.name}</td>
                    <td>{student.batch}</td>
                    <td>{student.course}</td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="4">No students found</td>
                </tr>
              )}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
}

export default Dashboard;
